    <style>
      * {
        font-family: "DM Sans";
      }
      body {
        padding: 0;
        margin: 0;
        height: 100%;
        background-color: #525252;
      }
      #root {
        background-color: gray;
        height: 400px;
        margin: 0 10px;
        padding: 6px;
        overflow-y: scroll;
        margin-top: 10px;
      }
      #root * {
        color: aliceblue;
      }
      .message {
        background-color: rgb(73, 73, 73);
        display: inline-block;
        padding: 5px;
        border-radius: 6px;
      }
      .message span {
        padding: 0 15px;
        white-space: pre-wrap;
        line-height: 25px;
      }
      .server {
        background-color: brown;
      }
      #root time {
        background-color: rgb(35, 200, 255);
        display: inline-block;
        padding: 3px 12px;
        color: black;
        border-radius: 5px;
      }
      .field {
        position: fixed;
        bottom: 13px;
        left: 0;
        width: 100%;
        display: none;
        justify-content: center;
      }
      .field input {
        padding: 5px;
        font-size: 15px;
        width: 300px;
      }
      #text {
        background-color: black;
        color: lime;
        padding: 5px;
        display: block;
        text-align: center;
      }
      #online {
        position: absolute;
        top: 20px;
        left: 12px;
        color: aliceblue;
        padding: 2px 7px;
        border-radius: 12px;
        background-color: rgb(66, 49, 177);
      }
    </style>
